import React from "react";


const Bubble_Container = ({userChats}) => {

	return (


		<div className="bubble-container">
			<ul>
        {Object.entries(userChats).map(([key, value]) => (
          <li key={key}>
            <strong>{key}:</strong> {value}
          </li>
        ))}
      </ul>



	  	</div>
	);
};

export default Bubble_Container;
